Accounts_CustomFields_Description:
Validní JSON obsahující klíče polí s nastavením. Například:<br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Validní JSON kde klíče jsou kódy jazyků a obsahují překlady. Například <br/><code>{
 "en": {
  "Channels": "Rooms"
 },
 "pt": {
  "Channels": "Salas"
 }
}</code>

SAML_Custom_user_data_fieldmap_descripti:
Nastavte jak se uživatelská pole (jako email) přenáší ze záznmů v SAML.
Například `{"name":"cn", "email":"mail"}` vybere uživatelovo jméno z atributu cn a jeho e-mailovou adresu z atributu email.
Dostupné položky v Rocket.Chatu: `name`, `email` a `username`, vše ostatní je uloženo jako `customFields`.
Atribut který se nemění přiřaďte do klíče '__identifier__' aby byl použit jako jedinečný identifikátor uživatele.
Použít můžete také regulární výrazy a šablony. Šablony budou zpracovány jako první krom případů kdy používají výsledky regulárního výrazu.
```
{
  "email": "mail",
  "username": {
    "fieldName": "mail",
    "regex": "(.*)@.+$",
    "template": "user-__regex__"
  }. "name":{
   "fieldNames": [
      "firstName",
      "lastName"
    ],
    "template": "__firstName__ __lastName__"
  },
"__identifier__": "uid"
}
```
